title: Van Iwaarden Elektrotechniek
lsi: false
safe: true
source: '.'
incremental: false
highlighter: rouge
gist:
    noscript: false
kramdown:
    math_engine: mathjax
    syntax_highlighter: rouge
plugins:
    - jekyll-coffeescript
    - jekyll-default-layout
    - jekyll-gist
    - jekyll-github-metadata
    - jekyll-optional-front-matter
    - jekyll-paginate
    - jekyll-readme-index
    - jekyll-titles-from-headings
    - jekyll-relative-links
    - jekyll-feed
whitelist:
    - jekyll-coffeescript
    - jekyll-default-layout
    - jekyll-gist
    - jekyll-github-metadata
    - jekyll-optional-front-matter
    - jekyll-paginate
    - jekyll-readme-index
    - jekyll-titles-from-headings
    - jekyll-relative-links
    - jekyll-feed
